INSERT INTO `ref_klasifikasi` VALUES (1,'HK','HUKUM','HUKUM');
INSERT INTO `ref_klasifikasi` VALUES (2,'HK.00','PERATURAN PERUNDANG-UNDANGAN','Surat-surat yang berkenaan dengan proses penyusunan peraturan perundang-undangan produk Mahkamah Agung, dari konsep / draf smpai selesai, maupun produk peraturan perundang-undangan yang diterima baik intern Mahkamah Agung maupun dari instansi lainnya.');
INSERT INTO `ref_klasifikasi` VALUES (3,'HK.00.1','PERATURAN PERUNDANG-UNDANGAN','Undang-undang, termasuk PERPU');
INSERT INTO `ref_klasifikasi` VALUES (4,'HK.00.2','PERATURAN PERUNDANG-UNDANGAN','Peraturan Pemerintah.');
INSERT INTO `ref_klasifikasi` VALUES (5,'HK.00.3','PERATURAN PERUNDANG-UNDANGAN','Keputusan Presiden, Instruksi Presiden, Penetapan Presiden.');
INSERT INTO `ref_klasifikasi` VALUES (6,'HK.00.4','PERATURAN PERUNDANG-UNDANGAN','Peraturan Ketua Mahkamah Agung RI.');
INSERT INTO `ref_klasifikasi` VALUES (7,'HK.00.5','PERATURAN PERUNDANG-UNDANGAN','Keputusan Ketua Mahkamah Agung, Instruksi Mahkamah Agung.');
INSERT INTO `ref_klasifikasi` VALUES (8,'HK.00.6','PERATURAN PERUNDANG-UNDANGAN','Keputusan Pejabat Eselon I.');
INSERT INTO `ref_klasifikasi` VALUES (9,'HK.00.7','PERATURAN PERUNDANG-UNDANGAN','Surat Edaran Pejabat Eselon I.');
INSERT INTO `ref_klasifikasi` VALUES (10,'HK.00.8','PERATURAN PERUNDANG-UNDANGAN','Peraturan Pengadilan Tingkat Banding dan Tingkat Pertama.');
INSERT INTO `ref_klasifikasi` VALUES (11,'HK.00.9','PERATURAN PERUNDANG-UNDANGAN','Peraturan PEMDA Tk. I, dan PEMDA Tk. II.');
INSERT INTO `ref_klasifikasi` VALUES (12,'HK.01','PIDANA','Surat-surat yang berkenaan dengan penyelesaian perkara pidana, baik pidana kejahatan maupun pidana pelanggaran.');
INSERT INTO `ref_klasifikasi` VALUES (176,'HK.02','PERDATA','Surat-surat yang berkenaan dengan penyelesaian perkara perdata, baik gugatan maupun permohonan.');
INSERT INTO `ref_klasifikasi` VALUES (177,'HK.03','PERDATA NIAGA','Surat-surat yang berkenaan dengan penyelesaian perkara perdata niaga.');
INSERT INTO `ref_klasifikasi` VALUES (178,'HK.04','PIDANA MILITER','Surat-surat yang berkenaan dengan penyelesaian perkara pidana militer.');
INSERT INTO `ref_klasifikasi` VALUES (179,'HK.05','PERDATA AGAMA','Surat-surat yang berkenaan dengan penyelesaian perkara perdata agama.');
INSERT INTO `ref_klasifikasi` VALUES (180,'HK.06','TATA USAHA NEGARA','Surat-surat yang berkenaan dengan penyelesaian perkara Tata Usaha Negara.');
INSERT INTO `ref_klasifikasi` VALUES (181,'HK.07','PIDANA KHUSUS','Surat-surat yang berkenaan dengan penyelesaian perkara pidana khusus.');
INSERT INTO `ref_klasifikasi` VALUES (182,'HM','KEHUMASAN','KEHUMASAN');
INSERT INTO `ref_klasifikasi` VALUES (183,'HM.00','PENERANGAN','\t\r\nSurat-surat yang berkenaan dengan segala kegiatan penerangan terhadap masyarakat tentang kegiatan Mahkamah Agung RI, termasuk di dalamnya :\r\n- konferensi pers,\r\n- pameran,\r\n- wawancara,\r\n- dan penerangan dalam media massa lainnya.');
INSERT INTO `ref_klasifikasi` VALUES (184,'HM.01','HUBUNGAN DAN KEPROTOKOLAN','-');
INSERT INTO `ref_klasifikasi` VALUES (185,'HM.01.1','HUBUNGAN','Surat-surat yang berhubungan dengan segala kegiatan intern Mahkamah Agung RI, dan antara Mahkamah Agung RI dengan pihak lain, baik dalam maupun luar negeri dalam bidang kehumasan, koordinasi, antara lain :\r\n- bakohumas,\r\n- hearing DPR,\r\n- kelompok kerja (POKJA),\r\n- dan organisasi-organisasi mass media.');
INSERT INTO `ref_klasifikasi` VALUES (186,'HM.01.2','KEPROTOKOLAN','Surat-surat yang berkaan dengan masalah keprotokolan, seperti :\r\n- tamu-tamu pimpinan Mahkamah Agung RI baik dalam maupun luar negeri,\r\n- kunjungan kerja pimpinan dan pejabat Mahkamah Agung RI,\r\n- upacara hari nasional, dan\r\n- HUT Mahkamah Agung RI.');
INSERT INTO `ref_klasifikasi` VALUES (187,'HM.02','DOKUMENTASI, KEPUSTAKAAN DAN TEKNOLOGI INFORMASI','-');
INSERT INTO `ref_klasifikasi` VALUES (188,'HM.02.1','DOKUMENTASI','Surat-surat yang berkenaan dengan kegiatan yang berhubungan dengan penyediaan / pengumpulan bahan / dokumentasi, termasuk penyebarannya.');
INSERT INTO `ref_klasifikasi` VALUES (189,'HM.02.2','KEPUSTAKAAN','Surat-surat yang berkenaan dengan kegiatan yang berhubungan dengan penyediaan, pengumpulan, dan penataan bahan-bahan kepustakaan.');
INSERT INTO `ref_klasifikasi` VALUES (190,'HM.02.3','TEKNOLOGI INFORMASI','Surat-surat yang berkenaan dengan kegiatan yang berhubungan dengan perencanaan, penyediaan, pemeliharaan, pengelolaan dan hal-hal lain yang berkaitan dengan teknologi informasi.');
INSERT INTO `ref_klasifikasi` VALUES (191,'KP','KEPEGAWAIAN','-');
INSERT INTO `ref_klasifikasi` VALUES (192,'KP.00','PENGADAAN','-');
INSERT INTO `ref_klasifikasi` VALUES (193,'KP.00.1','FORMASI','Surat-surat yang berkenaan dengan perencanaan pengadaan pegawai, nota usul formasi, sampai dengan persetujuan termasuk di dalamnya besetting.');
INSERT INTO `ref_klasifikasi` VALUES (194,'KP.00.2','PENERIMAAN','Surat-surat yang berkenaan dengan penerimaan pegawai baru, mulai dari pengumuman penerimaan, panggilan testing / psikotes / clearance test, sampai dengan pengumuman yang diterima, termasuk di dalamnya pegawai honorer, seperti :\r\n- satpam,\r\n- pramusaji,\r\n- supir.');
INSERT INTO `ref_klasifikasi` VALUES (195,'KP.00.3','PENGANGKATAN','Surat-surat yang berkenaan dengan seluruh proses pengangkatan, dan penempatan calon pegawai (CPNS) sampai dengan menjadi pegawai (PNS), mulai dari persyaratan, pemeriksaan kesehatan dan keterangan-keterangan lainnya yang berhubungan dengan pengangkatan.');
INSERT INTO `ref_klasifikasi` VALUES (196,'KP.01','TATA USAHA KEPEGAWAIAN','-');
INSERT INTO `ref_klasifikasi` VALUES (197,'KP.01.1','IZIN / DISPENSASI','Surat-surat yang berkenaan dengan izin tidak masuk kerja atas permintaan yang diajukan oleh pegawai yang bersangkutan, maupun dispensasi yang diajukan oleh instansi lain termasuk tugas pada instansi lain baik tugas belajar maupun tugas di luar negeri bagi pegawai Mahkamah Agung RI.');
INSERT INTO `ref_klasifikasi` VALUES (198,'KP.01.2','KETERANGAN','Surat-surat yang berkenaan dengan keterangan pegawai dan keluarganya, termasuk surat-surat yang berkaitan dengan NIP, KARPEG, KARSU / KARIS dan data pegawai / pejabat.');
INSERT INTO `ref_klasifikasi` VALUES (199,'KP.02','PENILAIAN DAN HUKUMAN','-');
INSERT INTO `ref_klasifikasi` VALUES (200,'KP.02.1','PENILAIAN','Surat-surat yang berkenaan dengan penilaian pelaksanaan pekerjaan, disiplin pegawai, pemalsuan administrasi kepegawaian, rehabilitasi dan pemulihan nama baik.');
INSERT INTO `ref_klasifikasi` VALUES (201,'KP.02.2','HUKUMAN','Surat-surat yang berkenaan dengan hukuman pegawai, meliputi :\r\n- teguran tertulis,\r\n- pernyataan tidak puas secara tertulis,\r\n- penundaan kenaikan gaji berkala untuk paling lama 1 (satu) tahun,\r\n- penurunan gaji sebesar 1 (satu) kalli kenaikan gaji berkala untuk paling lama 1 (satu) tahun,\r\n- penundaan kenaikan pangkat untuk paling lama 1 (satu) tahun,\r\n- penurunan pangkat pada pangkat yang setingkat lebih rendah untuk paling lama 1 (satu) tahun,\r\n- pembebasan dan jabatan,\r\n- pemberhentian dengan hormat tidak atas permintaan sendiri sebagai PNS / tenaga teknis / tenaga fungsional,\r\n- pemberhentian tidak dengan hormat sebagai PNS.');
INSERT INTO `ref_klasifikasi` VALUES (202,'KP.03','PEMBINAAN MENTAL','Surat-surat yang berkenaan dengan pembinaan mental pegawai, termasuk di dalamnya pembinaan kerohanian.');
INSERT INTO `ref_klasifikasi` VALUES (203,'KP.04','MUTASI','-');
INSERT INTO `ref_klasifikasi` VALUES (204,'KP.04.1','KEPANGKATAN','Surat-surat yang berkenaan dengan kenaikan dengan kenaikan pangkat / golongan, termasuk di dalamnya ujian dinas, ujian penyesuaian ijazah, dan daftar urut kepangkatan.');
INSERT INTO `ref_klasifikasi` VALUES (205,'KP.04.2','KENAIKAN GAJI BERKALA','Surat-surat yang berkenaan dengan kenaikan gaji berkala.');
INSERT INTO `ref_klasifikasi` VALUES (206,'KP.04.3','PENYESUAIAN MASA KERJA','Surat-surat yang berkenaan dengan penyesuaian masa kerja untuk perubahan ruang gaji dan impassing.');
INSERT INTO `ref_klasifikasi` VALUES (207,'KP.04.4','PENYESUAIAN TUNJANGAN KELUARGA','Surat-surat yang berkenaan dengan penyesuaian tunjangan keluarga.');
INSERT INTO `ref_klasifikasi` VALUES (208,'KP.04.5','ALIH TUGAS','Surat-surat yang berkenaan dengan alih tugas bagi para pelaksana / staf, perpindahan dalam rangka pemantapan tugas kerja termasuk mengenai fasilitasnya.');
INSERT INTO `ref_klasifikasi` VALUES (209,'KP.04.6','JABATAN STRUKTURAL / FUNGSIONAL','Surat-surat yang berkenaan dengan pengangkatan dan pemberhentian dalam jabatan struktural / fungsional, termasuk tunjangan sewaktu penugasan atau pemberian kuasa untuk menjabat sementara.');
INSERT INTO `ref_klasifikasi` VALUES (210,'KP.05','KESEJAHTERAAN','-');
INSERT INTO `ref_klasifikasi` VALUES (211,'KP.05.1','KESEHATAN','Surat-surat yang berkenaan dengan penyelenggaraan kesehatan bagi pegawai, meliputi :\r\n- asiuansi kesehatan,\r\n- general check up bagi pimpinan dan pejabat.');
INSERT INTO `ref_klasifikasi` VALUES (212,'KP.05.2','CUTI','Surat-surat yang berkenaan dengan cuti pegawai, meliputi :\r\n- cuti sakit,\r\n- cuti hamil / bersalin, dan\r\n- cuti diluar tanggungan negara.');
INSERT INTO `ref_klasifikasi` VALUES (213,'KP.05.3','REKREASI DAN OLAH RAGA','Surat-surat yang berkenaan dengan rekreasi dan olah raga.');
INSERT INTO `ref_klasifikasi` VALUES (214,'KP.05.4','BANTUAN SOSIAL','Surat-surat yang berkenaan dengan pemberian bantuan / tunjangan sosial kepada pegawai dan keluarga yang mengalamai musibah, termasuk ucapan bela sungkawa');
INSERT INTO `ref_klasifikasi` VALUES (215,'KP.05.5','KOPERASI','Surat-surat yang berkenaan dengan organisasi koperasi termasuk didalamnya masalah pengurusan kebutuhan pokok.');
INSERT INTO `ref_klasifikasi` VALUES (216,'KP.05.6','PERUMAHAN','Surat-surat yang berkenaan dengan perumahan pegawai, pejabat struktural / fungsional, pimpinan dan hakim agung.');
INSERT INTO `ref_klasifikasi` VALUES (217,'KP.05.7','ANTAR JEMPUT','Surat-surat yang berkenaan dengan transportasi pegawai.');
INSERT INTO `ref_klasifikasi` VALUES (218,'KP.05.8','PENGHARGAAN','Surat-surat yang berkenaan dengan penghargaan, tanda jasa, piagam, satya lencana, dan sejenisnya.');
INSERT INTO `ref_klasifikasi` VALUES (219,'KP.06','PEMUTUSAN HUBUNGAN KERJA','Surat-surat yang berhubungan dengan pensiun pegawai, termasuk jaminan-jaminan asuransi karena berhenti atas permintaan sendiri, berhenti dengan hormat bukan karena hukuman, pindah / keluar dari MA RI dan meninggal dunia.');
INSERT INTO `ref_klasifikasi` VALUES (220,'KS','KESEKRETARIATAN','-');
INSERT INTO `ref_klasifikasi` VALUES (221,'KS.00','KERUMAHTANGGAN','Surat-surat yang berkenaan dengan :\r\n- penggunaan fasilitas,\r\n- ketertiban dan keamanan,\r\n- konsumsi,\r\n- pakaian dinas,\r\n- papan nama,\r\n- stempel,\r\n- lambang,\r\n- alamat kantor dan pejabat,\r\n- telekomunikasi, listrik, air,\r\n- dan lain sebagainya.');
INSERT INTO `ref_klasifikasi` VALUES (222,'KU','KEUANGAN','-');
INSERT INTO `ref_klasifikasi` VALUES (223,'KU.00','AKUNTANSI','Surat-surat yang berkenaan dengan penyiapan bahan pelaksanaan dan pembinaan pembukuan keuangan serta penyusunan perhitungan anggaran.');
INSERT INTO `ref_klasifikasi` VALUES (224,'KU.01','PELAKSANAAN ANGGARAN','Surat-surat yang berkenaan dengan penyiapan bahan bimbingan dalam pelaksanaan penggunaan anggaran dan pertanggung jawaban keuangan.');
INSERT INTO `ref_klasifikasi` VALUES (225,'KU.02','VERIVIKASI DAN TUNTUTAN GANTI RUGI','Surat-surat yang berkenaan dengan penyiapan bahan pencatatan, penelitian, pembinaan, dan penyusunan laporan tentang verivikasi dan tuntutan ganti rugi.');
INSERT INTO `ref_klasifikasi` VALUES (226,'KU.03','PERBENDAHARAAN','Surat-surat yang berkenaan dengan penyiapan bahan bimbingan dalam ketatausahaan perbendaharaan, penyelesaian masalah perbendaharaan, dan pelaksanaan pembinaan bendaharawan.');
INSERT INTO `ref_klasifikasi` VALUES (227,'KU.04','PENDAPATAN NEGARA','-');
INSERT INTO `ref_klasifikasi` VALUES (228,'KU.04.1','PAJAK','Surat-surat yang berkenaan dengan pendapatan negara dan hasil pajak yang meliputi :\r\n- MPO (Menghitung Pajak Orang),\r\n- PPN (Pajak Pendapatan Negara),\r\n- Pajak Jasa,\r\n- PPH (Pajak Pendapatan Penghasilan),\r\n- PPN (Pajak Pertambahan Nilai),\r\n- dan pajak lainnya.');
INSERT INTO `ref_klasifikasi` VALUES (229,'KU.04.2','BUKAN PAJAK','Surat-surat yang berkenaan dengan pendapatan negara dan hasil bukan pajak yang meliputi penerimaan dan :\r\n- biaya perkara,\r\n- biaya salinan putusan,\r\n- biaya sewa dari inventaris negara,\r\n- hasil penjualan barang-barang inventaris yang dihapus,\r\n- dan penerimaan negara bukan pajak lainnya.');
INSERT INTO `ref_klasifikasi` VALUES (230,'KU.05','PERBANKAN','Surat-surat yang berkenaan dengan perbankan, antara lain :\r\n- pembukaan rekening,\r\n- spasement tanda tangan,\r\n- valuta asing,\r\n- rekening koran, dan\r\n- proyek perbankan lainnya.');
INSERT INTO `ref_klasifikasi` VALUES (231,'KU.06','SUMBANGAN / BANTUAN','Surat-surat yang berkenaan dengan permintaan, pemberian sumbangan / bantuan khusus diluar tugas pokok Mahkamah Agung RI, seperti :\r\n- bencana alam,\r\n- kebakaran,\r\n- banjir,\r\n- qurban,\r\n- pekan olah raga,\r\n- dan lain sebagainya.');
INSERT INTO `ref_klasifikasi` VALUES (232,'OT','ORGANISASI DAN TATA LAKSANA','-');
INSERT INTO `ref_klasifikasi` VALUES (233,'OT.00','ORGANISASI','Surat surat yang berhubungan dengan pembentukan, perubahan organisasi, uraian pekerjaan dan pembahasannya mulai dari awal sampai akhir dan jalur pertanggung jawabannya');
INSERT INTO `ref_klasifikasi` VALUES (234,'OT.01.1','PERENCANAAN','Surat surat yang berhubungan dengan penyusunan perencanaan / program kerja oleh unit-unit kerja Mahkamah Agung secara keseluruhan, termasuk segala jenis pertemuan dalam rangka penentuan kebijaksanaan perencanaan.');
INSERT INTO `ref_klasifikasi` VALUES (235,'OT.01.2','LAPORAN','Surat surat yang berhubungan dengan laporan umum, monitoring, evaluasi dan unit kerja, baik laporan :\r\n- bulanan,\r\n- triwulan,\r\n- semester, dan\r\n- tahunan.');
INSERT INTO `ref_klasifikasi` VALUES (236,'OT.01.3','PENYUSUNAN PROSEDUR KERJA','Surat-surat yang berkenaan dengan penyusunan sistem, prosedur, pedoman, petunjuk pelaksanaan, tata kerja dan hubungan kerja.');
INSERT INTO `ref_klasifikasi` VALUES (237,'OT.01.4','PENYUSUNAN PEMBAKUAN SARANA KERJA','Surat-surat yang berhubungan dengan penyusunan pembakuan sarana kerja, yakni penentuan kualitas dan kuantitas yang meliputi :\r\n- ukuran,\r\n- jenis,\r\n- merek dan sebagainya.');
INSERT INTO `ref_klasifikasi` VALUES (238,'PB','PENELITIAN DAN PENGEMBANGAN','-');
INSERT INTO `ref_klasifikasi` VALUES (239,'PB.00','PENELITIAN HUKUM','Surat-surat yang berkenaan dengan penelitian dan pengembangan hukum, sejak dari awal perencanaan, perizinan, pelaksanaan, sampai dengan pelaporan hasil penelitian.');
INSERT INTO `ref_klasifikasi` VALUES (240,'PB.01','PENELITIAN PERADILAN','Surat-surat yang berkenaan dengan penelitian dan pengembangan peradilan, sejak dari perencanaan, perizinan, pelaksanaan, sampai dengan pelaporan hasil penelitian.');
INSERT INTO `ref_klasifikasi` VALUES (241,'PB.02','PENGEMBANGAN PENELITIAN','Surat-surat yang berkenaan dengan masalah-masalah pengembangan penelitian dan perencanaan, pelaksanaan, sampai dengan pelaporan');
INSERT INTO `ref_klasifikasi` VALUES (242,'PL','PERLENGKAPAN','-');
INSERT INTO `ref_klasifikasi` VALUES (243,'PL.01','GEDUNG DAN RUMAH DINAS','Surat-surat yang berkenaan dengan perencanaan, pengadaan, pelelangan, pendistribusian, pemeliharaan dan penghapusan, antara lain :\r\n- bangunan kantor,\r\n- rumah dinas,\r\n- mes,\r\n- pos jaga,\r\n- persetujuan gambar gedung,\r\n- dan lain sebagainya.');
INSERT INTO `ref_klasifikasi` VALUES (244,'PL.02','TANAH','Surat-surat yang berkenaan dengan perencanaan, pengadan /pelelangan, pemeliharaan, penghapusan dan tukar guling tanah.');
INSERT INTO `ref_klasifikasi` VALUES (245,'PL.03','ALAT KANTOR','Surat-surat yang berkenaan dengan perencaan, pengadaan, pelelangan, pendistribusian, pemeliharaan dan penghapusan, antara lain :\r\n- ATK (Alat Tulis Kantor),\r\n- formulir-formulir,\r\n- dan lain-lain.');
INSERT INTO `ref_klasifikasi` VALUES (246,'PL.04','MESIN KANTOR / ALAT-ALAT ELEKTRONIK','Surat-surat yang berkenaan dengan perencanaan, pengadaan, pelelangan, pendistribusian, pemeliharaan dan penghapusan, antara lain :\r\n- AC,\r\n- laptop,\r\n- komputer / PC,\r\n- radio,\r\n- slide,\r\n- mesin stensil,\r\n- tape recorder,\r\n- teleks,\r\n- video taper,\r\n- infocus,\r\n- amplifier,\r\n- foto copy,\r\n- kamera,\r\n- kalkulator / mesin hitung,\r\n- mesin ketik,\r\n- overhead proyektor,\r\n- proyektor film\r\n- dan sebagainya.');
INSERT INTO `ref_klasifikasi` VALUES (247,'PL.05','PERABOT KANTOR','Surat-surat yang berkenaan dengan perencanaan, pengadaan, pelelangan, pendistribusian, pemeliharaan, dan penghapusan, antara lain :\r\n- kursi,\r\n- meja,\r\n- lemari,\r\n- filing cabinet rak,\r\n- dan lain-lain yang sejenis.');
INSERT INTO `ref_klasifikasi` VALUES (248,'PL.06','KENDARAAN','Surat-surat yang berkenaan dengan masalah kendaraan dari perencanaan, pengadaan, pelelangan, pendistribusian, pemeliharaan dan penghapusan.');
INSERT INTO `ref_klasifikasi` VALUES (249,'PL.07','INVENTARIS PERLENGKAPAN','Surat-surat yang berkenaan dengan inventaris perlengkapan, laporan inventaris perlengkapan baik pusat maupun daerah.');
INSERT INTO `ref_klasifikasi` VALUES (250,'PL.08','PENAWARAN UMUM','Surat-surat yang berkenaan dengan pelelangan dari mulai persiapan pelelangan, penyusunan RKS, pelaksanaan pelelangan dan pengumuman pemenang, serta hal-hal lain yang berkaitan dengan pelaksanaan pelelangan.');
INSERT INTO `ref_klasifikasi` VALUES (251,'PL.09','KETATAUSAHAAN','Surat-surat yang berkenaan dengan korespondensi, kearsipan, penandatanganan surat dan wewenangnya, cap dinas, dan lain sebagainya.');
INSERT INTO `ref_klasifikasi` VALUES (252,'PP','PENDIDIKAN DAN PELATIHAN','');
INSERT INTO `ref_klasifikasi` VALUES (253,'PP.00','PENDIDIKAN DAN PELATIHAN TEKNIS','');
INSERT INTO `ref_klasifikasi` VALUES (254,'PP.00.1','HAKIM','Surat-surat yang berkenaan dengan perencanaan, pelaksanaan, dan evaluasi penyelenggaraan pendidikan dan pelatihan hakim.');
INSERT INTO `ref_klasifikasi` VALUES (255,'PP.00.2','PANITERA','Surat-surat yang berkenaan dengan perencanaan, pelaksanaan, dan evaluasi penyelenggaraan pendidikan dan pelatihan panitera.');
INSERT INTO `ref_klasifikasi` VALUES (256,'PP.00.3','JURU SITA','Surat-surat yang berkenaan dengan perencanaan, pelaksanaan, dan evaluasi penyelenggaraan pendidikan dan pelatihan juru sita.');
INSERT INTO `ref_klasifikasi` VALUES (257,'PP.00.4','TEKNIS LAINNYA','\t\r\nSurat-surat yang berkenaan dengan perencanaan, pelaksanaan, dan evaluasi penyelenggaraan pendidikan dan pelatihan teknis lainnya.');
INSERT INTO `ref_klasifikasi` VALUES (258,'PP.01','PENDIDIKAN DAN LATIHAN MANAJEMEN','');
INSERT INTO `ref_klasifikasi` VALUES (259,'PP.01.1','PENJENJANGAN','Surat-surat yang berkenaan dengan pendidikan penjenjangan, antara lain :\r\n- Diklatpim tingkat IV,\r\n- Dilatpim tingkat III,\r\n- Diklatpim tingkat II,\r\n- Diklatpim tingkat I,\r\n- LEMHANAS\r\nmulai dari perencanaan, pelaksanaan dan evaluasi.');
INSERT INTO `ref_klasifikasi` VALUES (260,'PP.01.2','KEPANGKATAN','Surat-surat yang berkenaan dengan pendidikan dan kepangkatan, antara lain :\r\n- Pra Jabatan,\r\n- SUSCATUR (Kursus Calon Pengatur),\r\n- SUSCATA (Kursus Calon Penata),\r\n- SUSCABIN (Kursus Calon Pembina),\r\nmulai dari perencanaan, pelaksanaan dan evaluasi.');
INSERT INTO `ref_klasifikasi` VALUES (261,'PP.01.3','LATIHAN / KURSUS / PENATARAN MANAJEMEN','Surat-surat yang berkenaan dengan latihan tenaga administrasi, kursus, dan penataran, di bidang manajemen atau lainnya, baik dalam maupun luar negeri, mulai dari perencanaan, pelaksanaan dan evaluasi.');
INSERT INTO `ref_klasifikasi` VALUES (262,'PS','PENGAWASAN','-');
INSERT INTO `ref_klasifikasi` VALUES (263,'PS.00','ADMINISTRASI UMUM','Surat-surat yang berkenaan dengan pengawasan administrasi umum, meliputi :\r\n- pengawasan ketatausahaan,\r\n- pengawasan kepegawaian,\r\n- pengawasan keuangan,\r\n- pengawasan perlengkapan,\r\ntermasuk Laporan Hasil Pemeriksaan (LHP) dan tindak lanjut pemeriksaan.');
INSERT INTO `ref_klasifikasi` VALUES (264,'PS.01','TEKNIS','Surat-surat yang berkenaan dengan pengawasan di bidang teknis peradilan mulai dari perencanaan, pelaksanaan dan Laporan Hasil Pemeriksaan (LHP) dan tindak lanjut pemeriksaan.');
INSERT INTO `ref_klasifikasi` VALUES (265,'KU.00.1','KEUANGAN','-');
